import React from 'react';

import { LogoWrapper } from './styled';

const Logo = () => (
    <div>
        <LogoWrapper href="/">
            <span data-letters-l="Bur" data-letters-r="ime">Burime</span>
        </LogoWrapper>
    </div>
);

export { Logo };
